import React from 'react'

const Faetures = ({features}) => {

  const categories = [
    "comfort",
    "entertainment",
    "exterior",
    "interior",
    "power",
    "safety",
  ];
  return (
    <div>
      <h3 className='text-2xl font-medium mb-6'>Features</h3>
      <div className="space-y-4">
        {
          console.log(features)
          // features.map((data,index)=>{
          //   console.log(data)
          // })
        }
        <div>
          {/*  */}
          <h4 className="text-base mb-4">Comfort</h4>
          <ul className="grid grid-cols-3 gap-2 text-sm font-medium text-gray-500">
            <li>comfort1</li>
            <li>comfort2</li>
            <li>comfort3</li>
            <li>comfort4</li>
            <li>comfort5</li>
            <li>comfort6</li>
            <li>comfort7</li>
            <li>comfort8</li>
            <li>comfort9</li>
            <li>comfort10</li>
          </ul>
        </div>
      </div>
    </div>
  )
}

export default Faetures
